import React from "react";

const Switch = ({ isOn, handleToggle }) => {
    return ( <
        div className = "switch-container" >
        <
        label className = "switch" >
        <
        input type = "checkbox"
        checked = { isOn }
        onChange = { handleToggle }
        /> <
        span className = "slider" > < /span> <
        /label> <
        /div>
    );
};

export default Switch;
